import { Fragment, useContext, useEffect } from 'react';
import '../MasterProfile/MasterProfile.css';
import { Link, useParams } from 'react-router-dom';
import { contextCreatetopic } from '../../contexts/contextCreatetopic';

const MasterProfile = ({ topics }) => {

    const params = useParams();
    const { topic, setTopic, 
            FIO, setFIO, 
            phoneNumber, setphoneNumber, 
            need, setNeed,
            problem, setProblem, 
            problemLocation, setProblemLocation,
            address, setAddress,
            date, setDate,
            paymentOption, setPaymentOption,
            detailsText, setDetailsText,
            detailsFiles, setDetailsFiles } = useContext(contextCreatetopic);

    const prev_page = params.pev_page;

    useEffect(() => {
        console.log(topic);
        console.log(FIO);
    },[])

    return(<Fragment>
        <div className='master-profile'>
            <Link to={`/${prev_page}`}>{prev_page}</Link>
            MasterProfile
        </div>
    </Fragment>)
}

export default MasterProfile;
